import React, { useState, useEffect } from 'react'
import axios from 'axios'
import { Group } from '@vx/group'
import { Circle } from '@vx/shape'
import { LinearGradient } from '@vx/gradient'
import { scaleLinear } from '@vx/scale'
import { useTooltip, Tooltip } from '@vx/tooltip'

function Compd() {
  const [data, setData] = useState([])
  const {
    tooltipData,
    tooltipLeft,
    tooltipTop,
    tooltipOpen,
    showTooltip,
    hideTooltip
  } = useTooltip()

  useEffect(() => {
    (async() => {
      let a = await axios.get('https://raw.githubusercontent.com/nychealth/coronavirus-data/master/tests-by-zcta.csv')
      let res = await a.data

      let 
        dump = [],
        lines = res.split('\r'),
        headers = lines[0].split(',')

      for (let i = 1; i < lines.length; i++) {
        let
          obj = {},
          line = lines[i].replace('\n', ''),
          curLine = line.split(',')

        if (parseInt(curLine[0]) === 99999 || !parseInt(curLine[0])) continue

        for (let j = 0; j < headers.length; j++) {
          obj[headers[j].toLowerCase().replace('.', '_')] = curLine[j] || 0
        }

        dump.push(obj)
      }

      setData(dump)
    })()
  }, [])

  let tooltipTimeout

  const 
    total = d => d.total,
    x = d => d.modzcta,
    y = d => d.positive

  const
    width = 650,
    height = 400,
    xMax = width - 40,
    yMax = height - 40

  const xScale = scaleLinear({
    domain: [Math.min(...data.map(x)), Math.max(...data.map(x))],
    range: [0 + 40, xMax],
    padding: 0.4,
    clamp: true
  })

  const yScale = scaleLinear({
    domain: [Math.min(...data.map(y)), Math.max(...data.map(y))],
    range: [yMax, 0],
    clamp: true
  })

  return (
    <>
      <svg width={width} height={height}>
        <LinearGradient 
            from="#b39cea" 
            to="#e99cea" 
            id="gradient"/>
        <rect width={width} height={height} fill="#fbc2eb" rx={14} />
        <Group top={40}
          onTouchStart={event => {
            if (tooltipTimeout) clearTimeout(tooltipTimeout)
            hideTooltip()
          }}
        >
          {data.map((d, i) => {
            const cx = xScale(x(d))
            const cy = yScale(y(d))
            const r = (total(d) / 250) * .75
            return (
              <Circle
                className="dot"
                cx={cx}
                cy={cy}
                r={r}
                fill="#ffffff"
                onMouseEnter={() => {
                  if (tooltipTimeout) clearTimeout(tooltipTimeout)
                  showTooltip({
                    tooltipLeft: cx + ((window.screen.width) / 2.55) ,
                    tooltipTop: cy + ((window.screen.height) / 3.75),
                    tooltipData: d
                  })
                }}
                onMouseLeave={() => {
                  tooltipTimeout = setTimeout(() => {
                    hideTooltip()
                  }, 200)
                }}
                onTouchStart={() => {
                  if (tooltipTimeout) clearTimeout(tooltipTimeout)
                  showTooltip({
                    tooltipLeft: cx,
                    tooltipTop: cy,
                    tooltipData: d
                  })
                }}
              />
            )
          })}
        </Group>
      </svg>
      {tooltipOpen && (
        <Tooltip left={tooltipLeft} top={tooltipTop}>
          <div className="ttStyle">
            <strong>Zip</strong> {x(tooltipData)}<br />
            <strong>Total</strong> {Number(total(tooltipData)).toLocaleString()}<br />
            <strong>Positive</strong> {Number(y(tooltipData)).toLocaleString()}
          </div>
        </Tooltip>
      )}

      <div className="descDiv">
        <div className="headerWrap">
          <span className="descriptionHeader">Borough Breakdown</span>
        </div>
        <div className="descWrap">
          <span className="description">
            Cumulative since the start of the outbreak<br />
            Age adjusted according to <a href="https://www.cdc.gov/nchs/data/statnt/statnt20.pdf">the US 2000 standard population</a>
          </span>
        </div>
      </div>
    </>
  )
}

export default Compd
